$(document).ready(function(){var e=[{brand:"DARKSTAR",price:"$49.99",name:"Collapse Pink Deck",width:"8.0 x 31.62",image:[{imageName:"Image 1 Alt",imageSrc:"./img/collapsepinkdeck.webp"},{imageName:"Image 2 Alt",imageSrc:"./img/collapsepinkback.webp"},{imageName:"Image 3 Alt",imageSrc:"./img/collapsepinkside.webp"}]}];$("#results").html("");for(let i=0;i<e.length;i++){var a=`
          <div class="card">
          <div class="swiper">
              <div class="swiper-wrapper">
                <div class="swiper-slide"><img src="${e[i].image[0].imageSrc}" alt="${e[i].image[0].imageName} image 1"></div>
                <div class="swiper-slide"><img src="${e[i].image[1].imageSrc}" alt="${e[i].image[1].imageName} image 2"></div>
                <div class="swiper-slide"><img src="${e[i].image[2].imageSrc}" alt="${e[i].image[2].imageName} image 3"></div>
              </div>
              <div class="swiper-pagination"></div>
          </div>
              <div class="card-details">
                  <h3>${e[i].brand}</h3>
                  <h4>${e[i].name}</h4>
                  <h6> Width: ${e[i].width}</h6>
                  <h5> Price: ${e[i].price}</h5>
              </div>
          </div>
      `;$("#results").append(a),document.querySelectorAll(".swiper").forEach(i=>{new Swiper(i,{direction:"vertical",loop:!0,pagination:{el:".swiper-pagination",clickable:!0}})})}new Swiper(".swiper",{direction:"vertical",loop:!0,pagination:{el:".swiper-pagination",clickable:!0}})});